const MealItem = (props) => {
    return (
        <div className={classes.mealItem}>
            <div className={classes.thumbNail}>
            </div>
            <h4 className='classes.mealTitle'></h4>
            <p className={classes.mealDescriptions}></p>
            <span className={classes.mealPrice}></span>
        </div>
    );
}

export default MealItem
